from typing import List

class Solution:
    def constructProductMatrix(self, grid: List[List[int]]) -> List[List[int]]:
        n, m = len(grid), len(grid[0])
        row_products = [1] * n
        col_products = [1] * m
        total_product = 1
        zero_rows = set()
        zero_cols = set()

        # Calculate row and column products
        for i in range(n):
            for j in range(m):
                if grid[i][j] != 0:
                    row_products[i] *= grid[i][j]
                    col_products[j] *= grid[i][j]
                    total_product *= grid[i][j]
                else:
                    zero_rows.add(i)
                    zero_cols.add(j)

        # Initialize the product matrix
        p = [[0 for _ in range(m)] for _ in range(n)]

        for i in range(n):
            for j in range(m):
                if i in zero_rows or j in zero_cols:
                    p[i][j] = 0
                else:
                    if len(zero_rows) == 0 and len(zero_cols) == 0:
                        # Exclude current cell's value
                        p[i][j] = total_product
                        for k in range(n):
                            if k != i and grid[k][j] != 0:
                                p[i][j] //= grid[k][j]
                        for l in range(m):
                            if l != j and grid[i][l] != 0:
                                p[i][j] //= grid[i][l]
                    else:
                        p[i][j] = 0
                    p[i][j] %= 12345

        return p
